pragma solidity ^0.6.4;

interface VETHER {
    function totalSupply() external view returns (uint);
    function balanceOf(address account) external view returns (uint);
    function transfer(address, uint) external returns (bool);
    function allowance(address owner, address spender) external view returns (uint);
    function approve(address, uint) external returns (bool);
    function transferFrom(address, address, uint) external returns (bool);
    event Transfer(address indexed from, address indexed to, uint value);
    event Approval(address indexed owner, address indexed spender, uint value);
    function currentEra() external view returns (uint);
    function currentDay() external view returns (uint);
    function burnEtherForMember(address member) external payable;
    function withdrawShare(uint era, uint day) external;
    function withdrawShareForMember(uint era, uint day, address member) external;
    function getEmissionShare(uint era, uint day, address member) external view returns (uint emissionShare);
    }

// Safe Math
library SafeMath {
    function sub(uint a, uint b) internal pure returns (uint) {
        assert(b <= a);
        return a - b;
    }

    function add(uint a, uint b) internal pure returns (uint)   {
        uint c = a + b;
        assert(c >= a);
        return c;
    }

    function mul(uint a, uint b) internal pure returns (uint) {
        if (a == 0) {
            return 0;
        }
        uint c = a * b;
        require(c / a == b, "SafeMath: multiplication overflow");
        return c;
    }

    function div(uint a, uint b) internal pure returns (uint) {
        require(b > 0, "SafeMath: division by zero");
        uint c = a / b;
        return c;
    }
}

contract VETHERBURN {
    using SafeMath for uint;

    address public vetherAddress;
    uint public _1 = 10**18;

    mapping(uint => mapping(uint => uint)) mapEraDays_Burnt;

    uint public memberCount;
    address[] public arrayMembers;
    mapping(address => MemberData) public mapMemberData;
    struct MemberData {
        uint etherToBurn;
        uint daysToBurn;
        uint lastDayBurnt;
    }

    // event Swapped(address assetFrom, address assetTo, uint inputAmount, uint transferAmount, uint outPutAmount, address recipient);

    constructor (address addressVether) public payable {
        vetherAddress = addressVether;
    }

    receive() external payable {

    }

    //==================================================================================//
    // Staking functions

    function deposit(uint dayCount) public payable returns (bool success) {
        mapMemberData[msg.sender].etherToBurn = msg.value;
        mapMemberData[msg.sender].daysToBurn = dayCount;   
        memberCount += 1; 
        arrayMembers.push(msg.sender);
        return true;
    }

    function burn(uint members) public returns (bool sucess){
        uint totalBurntForDay;
        for(uint i = 0; i <= members; i++){
            address member = arrayMembers[i];
            // check hasn't burn already
            mapMemberData[member].lastDayBurnt = VETHER(vetherAddress).currentDay();
            uint ethToBurn = mapMemberData[member].etherToBurn.div(mapMemberData[member].etherToBurn);
            totalBurntForDay += ethToBurn;
            vetherAddress.call.value(ethToBurn)(""); 
        }
    mapEraDays_Burnt[VETHER(vetherAddress).currentEra()][VETHER(vetherAddress).currentDay()] = totalBurntForDay;
    return true;
    }

    function withdraw(uint members, uint era, uint day) public returns (bool sucess){
        uint vetherToWihdraw = VETHER(vetherAddress).getEmissionShare(era, day, address(this));
        VETHER(vetherAddress).withdrawShare(era, day);
        uint totalForDay = mapEraDays_Burnt[era][day];
        for(uint i = 0; i <= members; i++){
            address member = arrayMembers[i];
            uint ethBurntForMember = mapMemberData[member].etherToBurn.div(mapMemberData[member].etherToBurn);
            uint share = (vetherToWihdraw.mul(ethBurntForMember)).div(totalForDay);
            VETHER(vetherAddress).transfer(member, share);
        }
        return true;
    }
}
